import React from 'react'
import { Outlet } from 'react-router-dom'

const MainHeader = () => {
    return (
        <>
        <Header/> 
        <Outlet/>
        </>
       
    )
}

const Header = ()=>{
    return(<Home/>)
}

const Home = () => {
  return (
    <div>home Page...</div>
  )
}

const About = () => {
    return (
      <div>About Page...</div>
    )
  }

 const Error = () => {
    return(
        <>
        <h2>Error...</h2>
        </>
    )
 } 

export {Home,About,Error,MainHeader}
